import React, { useState } from 'react';
import { Form, Button, Card, Container, Spinner, Alert } from 'react-bootstrap';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import Editor from '@monaco-editor/react';
import { FaSave, FaEye } from 'react-icons/fa';

// 1. Accept the 'theme' prop
const HomePage = ({ theme }) => {
  const [content, setContent] = useState('');
  const [language, setLanguage] = useState('javascript');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  // ... (handleSubmit and handleEditorChange functions remain the same)
  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError('');
    try {
      const response = await axios.post('http://localhost:5000/api/snippets', {
        content,
        language
      });
      navigate(`/snippet/${response.data.id}`);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to save snippet. Try again.');
      setIsLoading(false);
    }
  };
  function handleEditorChange(value, event) {
    setContent(value);
  }

  return (
    <Container className="mt-4">

      {/* 2. This is the new Hero Section! */}
      <div className="hero-section">
        <h1><FaEye className="me-3" />Share & Analyze Code</h1>
        <p className="lead">
          Paste your code, save it, and get instant analysis. Errors will be
          highlighted just like in your favorite editor.
        </p>
        {/* You could add an <img src="..." /> here! */}
      </div>

      {/* 3. The card now uses CSS variables, so no bg/text props needed */}
      <Card className="editor-card">
        <Card.Header as="h3" className="text-center">Create New Snippet</Card.Header>
        <Card.Body>
          <Form onSubmit={handleSubmit}>
            <Form.Group className="mb-3">
              <Form.Label>Language</Form.Label>
              <Form.Select 
                value={language} 
                onChange={(e) => setLanguage(e.target.value)}
              >
                <option value="javascript">JavaScript</option>
                <option value="python">Python</option>
                <option value="html">HTML</option>
                <option value="css">CSS</option>
                <option value="java">Java</option>
                <option value="plaintext">Plain Text</option>
              </Form.Select>
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>Code</Form.Label>
              <div style={{ border: '1px solid var(--border-dark)', borderRadius: '.25rem', overflow: 'hidden' }}>
                <Editor
                  height="60vh"
                  // 4. Set the editor theme based on the prop!
                  theme={theme === 'dark' ? 'vs-dark' : 'vs-light'}
                  language={language}
                  defaultValue="// Paste your code here..."
                  onChange={handleEditorChange}
                  options={{ minimap: { enabled: false } }}
                />
              </div>
            </Form.Group>

            {error && <Alert variant="danger">{error}</Alert>}

            <Button variant="primary" type="submit" disabled={isLoading} className="w-100">
              <FaSave className="me-2" />
              {isLoading ? 'Saving...' : 'Save & Share'}
            </Button>
          </Form>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default HomePage;
